import React from "react";

import Button from "../UI/Button/Button";

import styles from "./ListItem.module.css";

const ListItem = (props) => {
  return;
  <ul className={styles}>
    {props.lists.map((list) => (
      <li>
        Learn about &nbsp;
        <Button type="link" href={list.link}>
          {list.text}
        </Button>
      </li>
    ))}
  </ul>;
};

export default ListItem;
